  function updateISTClock() {
    // Get the current 
    const now = new Date();

    // Convert the current time to IST
    const offset = 5.5 * 60 * 60 * 1000; // IST offset in milliseconds
    const istNow = new Date(now.getTime() + offset);

    // Get the seconds part of the IST time
    const seconds = istNow.getUTCSeconds();

    // Update the display
    fs0.innerText = Math.floor(seconds / 10);
    fs1.innerText = seconds % 10;
    checkAndChangeClass()
  }

  // Update the clock every second
  setInterval(updateISTClock, 1000);

  // Initial call to display the time immediately
  updateISTClock();


