    function toggleClasses() {
      var divs = document.getElementsByClassName('UG');
      for (var i = 0; i < divs.length; i++) {
          if (divs[i].classList.contains('RS')) {
              divs[i].classList.remove('RS');
              divs[i].classList.add('GS');
          } else if (divs[i].classList.contains('GS')) {
              divs[i].classList.remove('GS');
              divs[i].classList.add('RS');
          } else {
              var randomNumber = Math.floor(Math.random() * 2);
              if (randomNumber === 0) {
                  divs[i].classList.add('RS');
              } else {
                  divs[i].classList.add('GS');
              }
          }
      }
  }
  setInterval(toggleClasses, 1000);

  
function getRandom6DigitNumber() {
  return Math.floor(100000 + Math.random() * 900000);
}

function getRandom12DigitNumber() {
  return Math.floor(100000000000 + Math.random() * 900000000000);
}
